import React from "react";
import styled from "styled-components";

function TextField({ placeholder, id }) {
  return <TextFieldWrapper placeholder={placeholder}/>;
}

const TextFieldWrapper = styled.input`
padding: 12px 20px;
margin-bottom: 40px;
display: inline-block;
border: 2px solid #ccc;
border-radius: 4px;
box-sizing: border-box;
margin-top:10px;
&& {
  :focus {
    outline: none;
    border: 2px solid #A02167;
  }
`;

export default TextField;
